import React from 'react';
import Text from "../../helpers/Text";
import IconAndText from "./IconAndText";
import facebook from "../../../image/facebook.svg"
import bi_phone from "../../../image/bi_phone.svg"
import insta from "../../../image/insta.svg"
import location from "../../../image/location.svg"
import contact_us from "../../../image/contact_us.png"
function TextAndImage(props) {
    const styleImage = {
        width:"90%"
    }
    return (
        <div className="row">
            <div style={{
                flex:0.7,
            }}>
                <div style={{marginTop:"5%"}}></div>
                <Text text="Those medals there for bungling at which you wear
                on your moth-eaten chest should be there
                for bungling at which you are best." fontWeight={400} size={"1rem"}/>
                <IconAndText text={"asdsadad"} icon={facebook}/>
                <IconAndText text={"asdsadad"} icon={bi_phone}/>
                <IconAndText text={"asdsadad"} icon={insta}/>
                <IconAndText text={"asdsadad"} icon={location}/>
            </div>
            <div style={{
                flex:0.5
            }}></div>
            <div style={{
                flex:0.6,
            }}>
                <img src={contact_us} alt=""  style={styleImage}/>
            </div>
        </div>
    );
}

export default TextAndImage;
